g2:c.PROCEDURE.g2:a.TEXT:
t-g2-name-for-items-test(node: class benchmark-node)
error-obj:class error;
val:value;
I:class item;
seq : sequence= sequence();
i2: symbol = the symbol item2;
i3_1 : symbol = the symbol item3_1;
i3_2 : symbol = the symbol item3_2;
t3_1 : text = "G2-ARRAY-XXX-ITEM3_1";

i4_1 : symbol = the symbol item4_1;
i4_2 : symbol = the symbol item4_2;
t4_2 : text = "G2-ARRAY-XXX-ITEM4_2";

i5_1 : symbol = the symbol item5_1;
i5_2 : symbol = the symbol item5_2;
t5_2 : text = "G2-ARRAY-XXX-ITEM5_2";

i6_1 : symbol = the symbol item6_1;
i6_2 : symbol = the symbol item6_2;
t6_1 : text = "G2-ARRAY-XXX-ITEM6_1";

i7_1 : symbol = the symbol item7_1;
i7_2 : symbol = the symbol item7_2;
i7_3 : symbol = the symbol item7_3;
i7_4 : symbol = the symbol item7_4;
i7_5 : symbol = the symbol item7_5;
i7_6 : symbol = the symbol item7_6;
t7_4 : text = "G2-ARRAY-XXX-ITEM7_4";

tr:truth-value;

begin


// 1)   Invalid item
	begin
		val = call g2-name-for-item(non-existant-item);
		call fail(node, "Called the system procedure on a non - existant -item.");	
		return;
	end
	on error(error-obj)
	end;	


// 2) item with a single unique name.

	for I = each item upon ws-2 
		do
		val = call g2-name-for-item(I);
		seq = insert-at-beginning(seq, val);
	end;
	if i2 is not a member of seq then
		begin
		call fail(node, "Expected [i2] to be a member of the [seq] but it is not");
		return;	
	end;
		
// 3) item with a single unique name, same as the primary name of other object.
	seq = sequence();
	for I = each item upon ws-3 
		do
		val = call g2-name-for-item(I);
		seq = insert-at-beginning(seq, val);
	end;

	if i3_2 is not a member of seq then
		begin
		call fail(node, "Expected [i3_2] to be a member of the [seq] but it is not");
		return;	
	end;
	tr = call verify-if-text-exists(seq, t3_1);	
	if tr /= true then
	begin
		call fail(node, "Expected [t3_1] to be an initial part  of a member 
						of the [seq] but it is not");
		return;	
	end;


// 4) item with a single unique name, same as the secondary name of other object.
	seq = sequence();
	for I = each item upon ws-4 
		do
		val = call g2-name-for-item(I);
		seq = insert-at-beginning(seq, val);
	end;

	if i4_1 is not a member of seq then
		begin
		call fail(node, "Expected [i4_1] to be a member of the [seq] but it is not");
		return;	
	end;
	tr = call verify-if-text-exists(seq, t4_2);	
	if tr /= true then
	begin
		call fail(node, "Expected [t4_2] to be an initial part  of a member 
						of the [seq] but it is not");
		return;	
	end;



// 5) item with a two names, primary being unique.
	seq = sequence();
	for I = each item upon ws-5 
		do
		val = call g2-name-for-item(I);
		seq = insert-at-beginning(seq, val);
	end;

	if i5_1 is not a member of seq then
		begin
		call fail(node, "Expected [i5_1] to be a member of the [seq] but it is not");
		return;	
	end;
	tr = call verify-if-text-exists(seq, t5_2);	
	if tr /= true then
	begin
		call fail(node, "Expected [t5_2] to be an initial part  of a member 
						of the [seq] but it is not");
		return;	
	end;


// 6) item with two names, secondary being unique.
	seq = sequence();
	for I = each item upon ws-6 
		do
		val = call g2-name-for-item(I);
		seq = insert-at-beginning(seq, val);
	end;

	if i6_2 is not a member of seq then
		begin
		call fail(node, "Expected [i6_2] to be a member of the [seq] but it is not");
		return;	
	end;
	tr = call verify-if-text-exists(seq, t6_1);	
	if tr /= true then
	begin
		call fail(node, "Expected [t6_1] to be an initial part  of a member 
						of the [seq] but it is not");
		return;	
	end;


// 7) Item with several names, some unique, some duplicate to other items' primary and/or secondary name(s)
	seq = sequence();
	for I = each item upon ws-7 
		do
		val = call g2-name-for-item(I);
		seq = insert-at-beginning(seq, val);
	end;

	if i7_1 is not a member of seq  or
	   i7_5 is not a member of seq  or	
	   i7_6 is not a member of seq  then
	   begin
	   call fail(node, "Expected [i7_1],[i7_5],[i7_6] to be members of the [seq] but it is not");
	   return;	
	end;
	if i7_3 is a member of seq  or
	   i7_2 is a member of seq  or	
	   i7_4 is a member of seq  then
	   begin
	   call fail(node, "Expected [i7_2],[i7_3],[i7_4] not to be members of the [seq] but it is not");
	   return;	
	end;
	tr = call verify-if-text-exists(seq, t7_4);	
	if tr /= true then
	begin
		call fail(node, "Expected [t7_4] to be an initial part  of a member 
						of the [seq] but it is not");
		return;	
	end;

    call pass(node);
end

verify-if-text-exists(seq:sequence, txt:text)=(truth-value)
I: text;
begin
    for I = each text in seq
    do
    if is-contained-in-text(txt, I) then
        return true;
    end;
    return false;
end
